INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 19814081, 104511, 1, 10, "で、でも、お祝いのケーキによって\n痛い思いをさせられたら、より高い\nところから突き落とされたみたいで\n興奮しますね……じゅるり♪", 1, 0.5, 0, 19814);
