INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 23814079, 105311, 1, 10, "うむ、ツッコむのもめんどくさい。\nともあれ、健康に誕生日を\n迎えたことはめでたいことだ！\nおめでとう、ユキ！", 1, 0.5, 0, 23814);
