INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 31114086, 102211, 1, 10, "ほ、欲しかったボードゲームが\nあるんですけど……いや、でも、\nあれって結構高かったっけ……？\nシノブさんにおねだりするのは……", 1, 0.5, 0, 31114);
