INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 31114096, 103111, 1, 10, "大丈夫ですよ、イリヤさん。\nいつも通りの、自由な雰囲気で\n祝ってもらう方が気も楽ですから。\nあなたも、きっとそうですよね？", 1, 0.5, 0, 31114);
