INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 3, 38614077, 105111, "", 1, "wac_birthday_talk_sad", "", "", 0.2, 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 21, 38614078, "vo_wac_38614", "", 0, "vo_wac_38614_002", 0, "", "", 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 38614079, 105111, 1, 10, "いえ、あのね？\nテーブルの下に、未使用のロウソクが\n大量に袋詰めしてあるんだけど。\nこれは、なに？", 1, 0.5, 0, 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 91, 38614080, 0, "", "", "", "", "", "", 38614);
