INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 3, 38614082, 100911, "", 1, "wac_birthday_talk_smile", "", "", 0.2, 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 21, 38614083, "vo_wac_38614", "", 0, "vo_wac_38614_003", 0, "", "", 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (0, 11, 38614084, 100911, 1, 10, "ああ、ミツキの年の数だけ\nロウソクを買ったつもりが、\nいざ実際の年齢を確認してみたら\n思ったより余ってしまって……", 1, 0.5, 0, 38614);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES ("", 91, 38614085, 0, "", "", "", "", "", "", 38614);
